import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate, Link } from 'react-router-dom';
import './AdminLogin.css';

const AdminLogin = ({ onLogin }) => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');

    try {
      const response = await axios.post('http://localhost:5000/admin/login', {
        email,
        password
      });

      localStorage.setItem('adminToken', response.data.token);
      localStorage.setItem('adminUser', JSON.stringify(response.data.user));
      onLogin(response.data.user);
      navigate('/admin/dashboard');
    } catch (error) {
      setError(error.response?.data?.message || 'Login failed');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="admin-login-container">
      {/* Left Section */}
      <div className="admin-login-left">
        <div className="welcome-content">
          <h1>Welcome to Admin Panel</h1>
          <p>Manage your video chat platform with ease. Access user analytics, monitor conversations, and ensure a safe environment for all users.</p>
          <div className="features">
            <div className="feature-item">
              <span>📊</span> User Analytics
            </div>
            <div className="feature-item">
              <span>🛡️</span> Safety Monitoring
            </div>
            <div className="feature-item">
              <span>⚙️</span> Platform Settings
            </div>
          </div>
        </div>
      </div>

      {/* Right Section */}
      <div className="admin-login-right">
        <div className="admin-login-card">
          <h2>Admin Login</h2>
          <form onSubmit={handleSubmit}>
            <div className="form-group">
              <label>Email:</label>
              <input
                type="email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                required
                placeholder="admin@videochat.com"
              />
            </div>
            <div className="form-group">
              <label>Password:</label>
              <input
                type="password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                required
                placeholder="Enter admin password"
              />
            </div>
            {error && <div className="error-message">{error}</div>}
            <button type="submit" disabled={loading}>
              {loading ? 'Logging in...' : 'Login'}
            </button>
          </form>
          <div className="admin-info">
            <p><strong>Demo Credentials:</strong></p>
            <p>Email: admin@videochat.com</p>
            <p>Password: admin123</p>
          </div>
          <div className="register-link">
            <p>Don't have an account? <Link to="/admin/register">Register here</Link></p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AdminLogin;
